import React, { useState, useEffect } from 'react'

import { getRooms } from '../util/roomApiUtil'

export default function Room() {
  const [rooms, setRooms] = useState([])

  useEffect(async () => {
    const rooms = await getRooms()
    setRooms(rooms)
  }, [])

  return (
    <div>
      <h4>Room 1</h4>
      {
        rooms.map(room => {
          <div className="room">
            <p>{room.number}</p>
          </div>
        })
      }
    </div>
  )
}
